import React from 'react';
import LoginCerberus from './login';
import { Route, useRouteMatch, Switch } from 'react-router-dom';

const Cerberus = () =>{  
  let match = useRouteMatch();
  return (
  <div className="Cerberus">
    <Switch>
      <Route path={`${match.path}/login`} component={LoginCerberus}></Route>
      <Route path={`${match.path}/home`} component={Cerberus}></Route>
    </Switch>
  </div> 
  );
}

export default Cerberus;
